  - id: 12
    name: File Report
    description: Enter one or more IPA IDs to view associated files (only those you
      have access to). Select one or more files with the checkboxes in the final column
      and click the Download button to download a zip file containing all the selected
      files.
    sql: "\r\nselect \r\nal.master_id,\r\nipa.ipa_id,\r\nal.extra_log_type \"session
      type\",\r\nal.select_status,\r\nfilestore_report_file_path(nfs_store_stored_files::nfs_store_stored_files,
      nfs_store_archived_files::nfs_store_archived_files) \"file path\", \r\nfilestore_report_perform_action(c.id,
      'activity_log__ipa_assignment_session_filestore', al.id, nfs_store_stored_files::nfs_store_stored_files,
      nfs_store_archived_files::nfs_store_archived_files) \"perform action: view file\",\r\nfilestore_report_select_fields(c.id,
      'activity_log__ipa_assignment_session_filestore', al.id, nfs_store_stored_files.id,
      nfs_store_archived_files.id) \"select items: download files\"\r\n\r\nfrom activity_log_ipa_assignment_session_filestores
      al\r\n\r\ninner join ipa_assignments ipa\r\non al.master_id = ipa.master_id\r\n\r\ninner
      join model_references mr\r\non mr.from_record_type = 'ActivityLog::IpaAssignmentSessionFilestore'\r\nand
      al.master_id = mr.from_record_master_id\r\nand al.id = mr.from_record_id\r\n\r\ninner
      join nfs_store_containers c\r\non mr.to_record_type = 'NfsStore::Manage::Container'\r\nand
      c.master_id = mr.to_record_master_id\r\nand c.id = mr.to_record_id\r\n\r\ninner
      join nfs_store_stored_files\r\non c.id = nfs_store_stored_files.nfs_store_container_id\r\n\r\nleft
      join nfs_store_archived_files\r\non nfs_store_stored_files.id = nfs_store_archived_files.nfs_store_stored_file_id\r\n\r\nwhere
      ipa.ipa_id in (:ipa_ids) AND al.select_status IN ('open', 'closed')\r\n\r\n\r\nAND
      :file_filtering_conditions_for_activity_log__ipa_assignment_session_filestore\r\n\r\n\r\norder
      by \r\n  ipa_id, \"session type\", \"file path\", \"perform action: view file\"
      \ \r\n;\r\n"
    search_attrs: "\r\n\r\nipa_ids: \r\n  number: \r\n    all: true\r\n    multiple:
      multiple\r\n    label: IPA IDs\r\n    disabled: false"
