  - id: 18
    name: Uploads
    description: "View individual file upload actions.\r\n\r\nEnter a date range to
      limit the number of results, and / or an IPA ID."
    sql: "select \r\n  up.id,\r\n  al.master_id,\r\n  ipa_id,\r\n  al.extra_log_type
      \"session type\",\r\n  up.path,\r\n  up.file_name,\r\n  up.content_type,\r\n
      \ up.file_size,\r\n  case when up.completed then 'yes' end \"completed\",\r\n
      \ ' ' || up.created_at::varchar \"created\",\r\n  u.email \"user\"\r\n  \r\nfrom
      nfs_store_uploads up\r\ninner join users u\r\non u.id = up.user_id\r\n\r\n\r\n\r\ninner
      join nfs_store_containers c\r\non c.id = up.nfs_store_container_id\r\n\r\ninner
      join model_references mr\r\non mr.to_record_type = 'NfsStore::Manage::Container'\r\nand
      mr.from_record_type = 'ActivityLog::IpaAssignmentSessionFilestore'\r\nand c.master_id
      = mr.to_record_master_id\r\nand c.id = mr.to_record_id\r\n\r\ninner join activity_log_ipa_assignment_session_filestores
      al\r\non al.master_id = mr.from_record_master_id\r\nand al.id = mr.from_record_id\r\n\r\n\r\ninner
      join ipa_assignments ipa\r\non al.master_id = ipa.master_id\r\n\r\nwhere \r\n
      \ (:from is null or up.created_at >= :from )\r\n  and (:to is null or up.created_at
      <= :to)\r\n  and (:ipa_id is null or ipa_id = :ipa_id)\r\norder by id desc\r\n;"
    search_attrs: "\r\n\r\nfrom: \r\n  date: \r\n    all: true\r\n    multiple: single\r\n
